import ItemCard from "../LayoutContent/ItemCard/ItemCard";

const LayoutMenu= ({changeResource, resource}) => {
    return  <Menu className="menu" theme="dark" defaultSelectedKeys={['1']} mode="inline">
        {
            resources.map(item => {
                return <Menu.Item className={resource === item.name ? 'activeTab' : 'noActiveTab'} key={item.key}
                                  onClick={() => changeResource(item.name)}>
                    <Link to={item.name}>{item.name}</Link>
